################################################################################
# FILENAME: datamap.cfg
#
# This configuration file is used by the sample "SCL Server" application
# (see \mmslite\mvl\usr\scl_srvr\scl_srvr.c).
# It should contain information to map "leaf names" to "user-defined text".
# The "user-defined text" may then be used in leaf functions.
# A DATA_MAP structure (see usermap.h) is allocated for each entry
# (one line of this file) and the entry
# information is stored in the DATA_MAP structure. The DATA_MAP structure
# may be accessed in the "read and write leaf functions" as demonstrated in
# "u_custom_rd_ind" and "u_custom_wr_ind" (see userleaf.c). These 2 example
# leaf functions may be customized by the user to use the DATA_MAP information
# to control data access.
#
# The expected format of this file is 3 columns separated by tabs. One line of
# the file is used to store information for one "leaf" by allocating one
# DATA_MAP structure and copying the information to it. The columns must contain
# the following:
#   COLUMN #1: Domain name
#   COLUMN #2: Leaf name
#   COLUMN #3: User text to be used by leaf function
# NOTE: extra columns are ignored.
#
# Every time the "SCL Server" application is executed, an output file
# "datamapout.cfg" is generated which contains all valid entries from this file,
# plus "sample entries" for any "leaf" that is NOT configured in this file.
# The "sample entries" in "datamapout.cfg" may be copied to this input file
# and modified to contain the appropriate "User Text" in COLUMN #3.
#
# CRITICAL:
# Any time objects are added, deleted, or changed in the SCL Configuration
# file (scl.xml), this file should be updated with appropriate data mapping.
################################################################################
